column8:
ラジオペンチ150mm<br>ラジオ・テレビ・精密機器の組立・内線工事・自動車や航空機の狭い部分での配線・折曲加工・切断作業に最適品です。特に先端が強靭で折れず、曲がらずかつ切れ味も抜群です。
<HTML>
<HEAD>



<TITLE></TITLE>
</HEAD>
<BODY>
<TABLE border="1">
  <TBODY>
    <TR>
      <TD>全長</TD>
      <TD colspan="2">約１５０ｍｍ</TD>
    </TR>
    <TR>
      <TD>全重量</TD>
      <TD colspan="2">約１２０ｇ</TD>
    </TR>
    <TR>
      <TD rowspan="2">切断能力(mm)</TD>
      <TD>鉄線</TD>
      <TD>銅線</TD>
    </TR>
    <TR>
      <TD>1.5mm</TD>
      <TD>2.6mm</TD>
    </TR>
    <TR>
      <TD>材質</TD>
      <TD colspan="2">クロムバナジウム鋼</TD>
    </TR>
    <TR>
      <TD>熱処理</TD>
      <TD colspan="2">無酸化焼入れ・刃部高周波焼入れ</TD>
    </TR>
    <TR>
      <TD>硬度（刃部）</TD>
      <TD colspan="2">HRC　６０～６２</TD>
    </TR>
  </TBODY>
</TABLE>
</BODY>
</HTML><style type="text/css">
<!--

div#HeaderKeyword {
	position:absolute;
	top:120px;/*一番上からの位置*/
	left:100px;/*左端からの位置*/
}

div#HeaderKeyword span {
	background: #bf0000;
	color:#fff;
	font-weight:bold;
	padding:2px 5px;
}

div#HeaderKeyword a {
	color:#0044CC;
}

td.inventory font{font-size:10px;color:#666666;}
td.inventory{word-wrap:break-word;width:80px;}

.footer_obi {
    background: #CF3 none repeat scroll 0% 0%;
    position: fixed;
	z-index:99999999;
    left: 0px;
    bottom: 0px;
    width: 100%;
    text-align: center;
    color: #000;
    font-size: 14px;
    font-weight: bold;
    /*opacity: 0.8;*/
    /*line-height: 16px;*/
    /*text-shadow: 0px 1px 0px #5C0000;*/
    /*padding: 13px 0px;*/
    display: block;
    }

	@media screen and (-webkit-min-device-pixel-ratio:0) {
.footer_obi {
	z-index:99999999;

 }
}

@media screen and (-ms-high-contrast: active), (-ms-high-contrast: none) {
  .footer_obi:not(:target) {
	z-index:99999999; /* IE10（\9なしでIE11にも適用） */
  }
}

/* お気に入り商品登録　*/
div.bookmarkArea {
	width:500px;
}

#rakutenLimitedId_aroundCart #serviceTableSml {
	margin-top:-7px;
}

body div.bkm{
	width: 240px !important;
	height: 70px !important;
}

body div.bookmarkArea div.bkm a.addBkm span.bkmStar {
	display:inline-block !important;
	width: 240px !important;
	height: 70px !important;

}

/* お気に入り店舗登録 */
body #rakutenLimitedId_aroundCart div.shopBkm {
	padding:7px 0 7px 10px !important;
	width: 240px !important;
	height: 70px !important;
}

body div.shopBookmarkArea div.shopBkm a.addShopBkm span.shopBkmStar {
	display:inline-block !important;
	width: 240px !important;
	height: 70px !important;

}

<!-- かご回り枠線 -->

span.catch_copy,
span.item_name {
line-height: 140%;
}

table#rakutenLimitedId_cart {
background-color: #f8f8f8;
border: 1px solid #ddd;
padding: 8px;
margin: 16px 0;
}

<!-- 項目選択肢デザイン -->
span.inventory_choice_name {

display: block;
width: 300px;
height: 30px;
font-size:12px;
margin-top:5px;
padding: 9px 0 0 35px;
}
-->
</style>


<div id="HeaderKeyword">
<span>注目のキーワード</span>
手すり 
